"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F86794&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 600px\">",
"   <div class=\"ttl\">",
"    Finger and toe swelling in psoriatic arthritis in children",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 580px; height: 260px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Photo A shows swelling of the 2nd and 4th toes. Photo B shows swelling of the thumb and pointer (1st) finger. The medical term for this type of swelling is \"dactylitis.\"",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
