var title_f32_0_32778="Doppler LA appendage flow during normal sinus rhythm";
var content_f32_0_32778=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54600%7ECARD%2F78275&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54600%7ECARD%2F78275&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Doppler interrogation of LA appendage flow during normal sinus rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 288px; height: 528px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A diagram of left atrial appendage (LAA) flow in sinus rhythm. is shown on panel A; panel B shows the pulsed-Doppler tracing of LAA flow. Phases of LAA flow include LAA contraction (1); LAA filing (2); systolic reflection waves (positive and negative) (3); early diastolic LAA outflow (4).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the American College of Cardiology (Journal of the American College of Cardiology, 1999, 34:1867-77.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Doppler interrogation of LA appendage flow during atrial fibrillation and atrial flutter",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 415px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The pulsed-Doppler tracing of LAA flow in atrial fibrillation is seen in panel A. Note the rapid fibrillatory flow waves, which are of higher velocity during ventricular diastole than systole (arrows). Pulsed-Doppler tracing of LAA flow in atrial flutter (with a 2:1 ventricular response) is seen in panel B. Flutter flow waves are, in general, slower and of higher velocity than fibrillatory flow waves.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the American College of Cardiology. Agmon, Y, Khandheria, BK, Gentile, F, Seward, JB. J Am Coll Cardio, 1999; 34:1867.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
