var title_f32_0_32779="Conventional approach to cardioversion";
var content_f32_0_32779=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F72971&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F72971&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Advantages and disadvantages of the conventional approach to cardioversion (one month of pretreatment with warfarin) in patients with atrial fibrillation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use of warfarin for one month before cardioversion may lower the stroke rate from 5.6 percent to a very low stroke rate of &lt;2 percent.",
"       </td>",
"       <td>",
"        Delaying cardioversion to normal sinus rhythm for one month potentially decreases functional capacity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Relatively easy to administer with regular monitoring of INRs.",
"       </td>",
"       <td>",
"        Prolonging treatment for&nbsp;seven to&nbsp;eight weeks one month prior to and one month after cardioversion increases the risk of bleeding complications.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Suitable for community hospitals.",
"       </td>",
"       <td>",
"        Not followed by routine clinical practice, especially in the elderly.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The conventional approach has withstood the \"test of time\" since the 1960s.",
"       </td>",
"       <td>",
"        Patients who are at the highest risk for developing systemic embolization who should receive more prolonged or intensive anticoagulation are not routinely identified.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the American College of Cardiology. J Am Coll Cardiol 2001; 37:691.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.elsevier.com/locate/jacc\">",
"      file://www.elsevier.com/locate/jacc",
"     </a>",
"     <br/>",
"     <a href=\" file://www.sciencedirect.com\">",
"      file://www.sciencedirect.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
