var title_f32_0_32780="Drugs pneumococcal meningitis children";
var content_f32_0_32780=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F79959&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F79959&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antimicrobial therapy for bacterial meningitis in children caused by Streptococcus pneumoniae based upon susceptibility test results in patients begun on vancomycin and either cefotaxime or ceftriaxone",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Susceptibility test results*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antibiotic management",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Susceptible to penicillin",
"       </td>",
"       <td>",
"        <p>",
"         Discontinue vancomycin",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         Begin penicillin (and discontinue cephalosporin)",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"        <p>",
"         Continue cefotaxime or ceftriaxone alone",
"         <sup>",
"          &Delta;",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <p>",
"         Not susceptible to penicillin (intermediate or resistant)",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         Susceptible to cefotaxime and ceftriaxone",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Discontinue vancomycin",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         Continue cefotaxime or ceftriaxone",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         Not susceptible to penicillin (intermediate or resistant)",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         Not susceptible to cefotaxime or ceftriaxone (intermediate or resistant)",
"        </p>",
"        <p>",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         Susceptible to rifampin",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Continue vancomycin",
"         <strong>",
"          AND",
"         </strong>",
"        </p>",
"        <p>",
"         Either cefotaxime",
"         <strong>",
"          OR",
"         </strong>",
"         ceftriaxone",
"        </p>",
"        <p>",
"         Rifampin may be added in selected circumstances",
"         <sup>",
"          &loz;",
"         </sup>",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Based upon quantitative susceptibility studies.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      See text for doses.",
"      <br>",
"       &Delta; Some physicians may choose this alternative for convenience and cost savings.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Addition of rifampin after 24 to 48 hours of therapy may be warranted if:",
"        <br>",
"         <ol>",
"          <li>",
"           Clinical condition worsens, or",
"          </li>",
"          <li>",
"           Gram stain or culture of repeat cerebrospinal fluid (CSF) indicates failure to substantially reduce bacterial number, or",
"          </li>",
"          <li>",
"           Cefotaxime or ceftriaxone minimum inhibitory concentration (MIC) of 4 mcg/mL or greater",
"          </li>",
"         </ol>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     From: American Academy of Pediatrics. Pneumococcal infections. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29th ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. Used with the permission of the American Academy of Pediatrics. Copyright &copy; 2012.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f32_0_32780=[""].join("\n");
