var title_f32_0_32781="Congenital toxoplasmosis initial evaluation";
var content_f32_0_32781=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F52918&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F52918&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Initial clinical evaluation of the newborn/infant with suspected congenital toxoplasmosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Test",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Clinical evaluations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Complete physical examination",
"       </td>",
"       <td>",
"        Fever, jaundice, hepatosplenomegaly, and lymphadenopathy are common findings in symptomatic infants (but the examination is normal in most cases)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Eye examination by ophthalmologist experienced in retinal examinations in newborn and young infants",
"       </td>",
"       <td>",
"        Chorioretinitis may be the only manifestation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Neurologic examination including CT of the head without contrast",
"       </td>",
"       <td>",
"        Intracranial calcifications or hydrocephalus may be the only manifestation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hearing assessment",
"       </td>",
"       <td>",
"        Currently recommended for all infants (in the United States)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Lumbar puncture",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CSF glucose, protein, cell count",
"       </td>",
"       <td>",
"        CSF abnormalities may be the only manifestation; CSF protein may be &gt;1 g/dL in severely affected infants but is typically lower in mild or subclinical disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxoplasma-specific PCR*",
"       </td>",
"       <td>",
"        Can establish the diagnosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Primary serology*",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxoplasma-specific IgG (ELISA)",
"       </td>",
"       <td>",
"        Does not differentiate maternal from infant infection in the newborn period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxoplasma-specific IgM (double sandwich ELISA)",
"       </td>",
"       <td>",
"        Indicative of congenital infection if not contaminated with maternal blood; negative IgM does not exclude congenital toxoplasmosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Additional serology*",
"        <sup>",
"         &bull;",
"        </sup>",
"        (complementary and more sensitive than primary serology)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxoplasma-specific IgA (ELISA/ISAGA)",
"       </td>",
"       <td>",
"        Indicative of congenital infection if not contaminated with maternal blood; especially useful if IgG and IgM assays are indeterminate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxoplasma-specific IgE (ELISA/ISAGA)",
"       </td>",
"       <td>",
"        Indicative of congenital infection if not contaminated with maternal blood; especially useful if IgG and IgM assays are indeterminate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Blood tests (primarily performed before initiating treatment in confirmed or suspected cases)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CBC with differential and platelet count",
"       </td>",
"       <td>",
"        Anemia and thrombocytopenia are common in symptomatic infants; also necessary to establish baseline before treatment, which may cause bone marrow suppression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Evaluation for G6PD deficiency (before initiation of treatment)",
"       </td>",
"       <td>",
"        Treatment with sulfadiazine may cause hemolysis in G6PD-deficient children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Liver function tests (aspartate aminotransferase, alanine aminotransferase, total and direct bilirubin)",
"       </td>",
"       <td>",
"        Primarily for baseline studies before initiating treatment; both direct and cholestatic jaundice may occur in infected infants",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum creatinine and urinalysis (before initiation of treatment)",
"       </td>",
"       <td>",
"        Sulfadiazine (or sulfamerazine or sulfamethazine) dosing requires adjustment in patients with renal insufficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urine for cytomegalovirus",
"       </td>",
"       <td>",
"        To exclude congenital cytomegalovirus, which may have similar clinical manifestations; coinfection with cytomegalovirus and toxoplasmosis may occur",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CT: computed tomography; CSF: cerebrospinal fluid; PCR: polymerase chain reaction; IgG: immunoglobulin G; ELISA: enzyme-linked immunosorbent assay; IgM: immunoglobulin M; IgA: immunoglobulin A; ISAGA: immunosorbent agglutination assay; IgE: immunoglobulin E; CBC: complete blood count; G6PD: glucose-6-phosphate-dehydrogenase.",
"     <br>",
"      * Performed or confirmed in a reference laboratory (eg, the Toxoplasmosis Serology Laboratory at the Palo Alto Medical Foundation Research Institute --",
"      <a href=\"file://www.pamf.org/serology\" target=\"_blank\">",
"       www.pamf.org/serology",
"      </a>",
"      ; the WHO/FAO International Centre for Research and Reference on Toxoplasmosis, Staten Serum Institute, Copenhagen, Denmark; the Toxoplasma Reference Laboratory, Public Health Laboratory, Singleton Hospital, Swansea, United Kingdom).",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       The same serologic tests should be performed on maternal serum; in addition, maternal serum should be obtained for differential agglutination test.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from:",
"     <br>",
"      <ol>",
"       <li>",
"        Remington JS, McLeod R, Wilson CB, Desmonts G. Toxoplasmosis. In: Infectious Diseases of the Fetus and Newborn Infant, 7th ed, Remington JS, Klein JO, Wilson CB, et al (Eds), Elsevier Saunders, Philadelphia 2011. p.918.",
"       </li>",
"       <li>",
"        Lynfield R, Ogunmodede F, Guerina NG. Toxoplasmosis. In: Oski's Pediatrics: Principles and Practice, 4th ed, McMillan JA, Feigin RD, DeAngelis CD, Jones MD (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2006. p.1351.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f32_0_32781=[""].join("\n");
var outline_f32_0_32781=null;
var title_f32_0_32782="Intravenous agents for pediatric procedural sedation";
var content_f32_0_32782=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F83512&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F83512&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Commonly used intravenous agents for pediatric procedural sedation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"10%\">",
"     </colgroup>",
"     <colgroup width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"6\">",
"        <strong>",
"         These agents should ONLY be administered by clinicians trained and experienced in pediatric procedural sedation using continuous non-invasive electronic monitoring of oxygenation, heart rate and blood pressure. End-tidal carbon dioxide monitoring is also suggested. Resuscitation equipment, medications, and personnel skilled in advanced pediatric life support and knowledgeable of sedatives and reversal agents must be present. Please refer to UpToDate topics on procedural sedation in children for more details.",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Agent",
"       </td>",
"       <td class=\"subtitle1\">",
"        Initial intravenous dose*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Repeat intravenous dose (as needed to achieve desired level of sedation)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Onset (minute)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Duration (minutes)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Ketamine",
"       </td>",
"       <td>",
"        <p>",
"         1 to 1.5 mg/kg",
"        </p>",
"        <p>",
"         when given with propofol, reduce initial dose to 0.5 mg/kg",
"        </p>",
"       </td>",
"       <td>",
"        0.5 to 1 mg/kg repeat every 10 minutes titrating to desired level of sedation",
"       </td>",
"       <td>",
"        1 to 2",
"       </td>",
"       <td>",
"        15 to 30",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Provides sedation AND analgesia for moderately to severely painful procedures. Less respiratory depression and complications than propofol alone or combinations of opioids with midazolam or with propofol.",
"         </li>",
"         <li>",
"          Common adverse events: Vomiting, emergence reaction, frequency of vomiting is reduced by premedication with ondansetron (0.15 mg/kg, typical dose 4 mg) or by co-administration of propofol",
"         </li>",
"         <li>",
"          Laryngospasm and apnea occur rarely and are more common with intramuscular administration",
"         </li>",
"         <li>",
"          Relative contraindications and precautions: Age younger than 12 months, active pulmonary infections (including URI), known or suspected cardiac disease, suspected increased intracranial pressure (eg, head trauma with signs or symptoms, intracranial mass, or hydrocephalus), glaucoma or acute eye injury (open globe), porphyria, thyroid disease",
"         </li>",
"         <li>",
"          Absolute contraindications: Age younger than 3 months or patients with known or suspected psychosis",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Midazolam",
"       </td>",
"       <td>",
"        <p>",
"         6 months&nbsp;to 5 years: 0.05 to 0.1 mg/kg IV, maximum single dose 2 mg&nbsp;",
"        </p>",
"        <p>",
"         6 to 12 years: 0.025 to 0.05 mg/kg IV, maximum single dose 2 mg",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         After initial IV dose, repeat after 2 to 5 minutes titrating to desired level of sedation",
"        </p>",
"        <p>",
"         6 months&nbsp;to 5 years: up to 0.2 mg/kg per dose (maximum total dose 6 mg),",
"        </p>",
"        <p>",
"         6 to 12 years: 0.1 mg/kg (maximum total dose 10 mg)",
"        </p>",
"       </td>",
"       <td>",
"        1 to 3",
"       </td>",
"       <td>",
"        15 to 60, depending upon total dose administered",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Provides sedation but NO analgesia. For painful procedures, an analgesic agent (eg, ketamine, fentanyl) should be co-administered.",
"         </li>",
"         <li>",
"          Provides amnesia, mild anxiolysis, and mild sedation for procedures that do not require full immobility (eg, laceration repair with local topical anesthesia)",
"         </li>",
"         <li>",
"          When combined with fentanyl can produce moderate or deep sedation, but less effective and more adverse respiratory events reported when compared to sedation with ketamine alone or combined with propofol",
"         </li>",
"         <li>",
"          Flumazenil can reverse effects but should be avoided in patients with seizure disorder or who are chronically maintained on benzodiazepines",
"         </li>",
"         <li>",
"          Common adverse effects: Respiratory depression, and apnea, especially when combined with opioid medications (eg, fentanyl); paradoxical reactions, including hyperactivity, aggressive behavior, and inconsolable crying",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Propofol",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         Initiate infusion at 25 mcg/kg per minute and titrate gradually to response (range 50 to 200 mcg/kg per minute)",
"         <sup>",
"          &Delta;",
"         </sup>",
"        </p>",
"        <p>",
"         OR",
"        </p>",
"        <p>",
"         0.5 to 1 mg/kg IV bolus dose (children two years of age and older)",
"        </p>",
"        <p>",
"         1 to 2 mg/kg IV bolus dose (infants 6 months to 2 years of age)",
"        </p>",
"        Significant dose reduction necessary for patients who are debilitated or with reduced cardiac output",
"       </td>",
"       <td>",
"        <p>",
"         Not applicable for continuous IV infusion, titrate infusion rate as needed",
"        </p>",
"        <p>",
"         OR",
"        </p>",
"        Additional IV bolus dose 0.5 mg/kg every 3 to 5 minutes titrating as needed up to 3 mg/kg. Wait at least 3 to 5 minutes between doses to assess effect.",
"       </td>",
"       <td>",
"        &le;0.5",
"       </td>",
"       <td>",
"        5 to 15 after single bolus dose, longer after prolonged infusion or when repeated bolus doses are given",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Provides sedation but NO analgesia. For painful procedures, an analgesic agent (eg, ketamine, fentanyl) should be co-administered. Commonly used for diagnostic imaging (CT, MRI).",
"         </li>",
"         <li>",
"          Rapid onset of sedation with good neurologic recovery. Reduces intracranial pressure.",
"         </li>",
"         <li>",
"          Peripheral injection site pain",
"          <sup>",
"           &Delta;",
"          </sup>",
"         </li>",
"         <li>",
"          Common adverse events: Respiratory depression, oxygen desaturation, apnea, hypotension, and/or rapid transition to deeper levels of sedation, especially with overly rapid administration of bolus injection",
"         </li>",
"         <li>",
"          Absolute contraindications: Egg or soy allergy, porphyria",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Dexmedetomidine",
"       </td>",
"       <td>",
"        <p>",
"         1 to 3 mcg/kg loading dose (over 10 minutes) followed by 0.5 to&nbsp;2 mcg/kg per",
"         <strong>",
"          hour",
"         </strong>",
"         continuous infusion",
"        </p>",
"        Children younger than 5 years of age may require maintenance infusion rates at the higher end of the range shown",
"       </td>",
"       <td>",
"        Not applicable for continuous infusion, titrate infusion rate as needed",
"       </td>",
"       <td>",
"        5 to 10",
"       </td>",
"       <td>",
"        30 to 70",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Sedation and modest analgesia without respiratory depression. Commonly used for diagnostic imaging (CT, MRI).",
"         </li>",
"         <li>",
"          Common adverse events: Bradycardia, hypertension, or, especially with loading dose, hypotension",
"         </li>",
"         <li>",
"          Relative contraindications: Children who are debilitated, inadequately hydrated, or have reduced cardiac output",
"         </li>",
"         <li>",
"          Absolute contraindication: Patients receiving digoxin or other medications acting on sinus node or with sinus node dysfunction",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Pentobarbital",
"       </td>",
"       <td>",
"        <p>",
"         1 to 2 mg/kg IV, maximum 100 mg per dose",
"        </p>",
"       </td>",
"       <td>",
"        1 to 2 mg/kg IV every 3 to 5 minutes titrate up to 6 mg/kg to desired sedation",
"       </td>",
"       <td>",
"        1&nbsp;to 5",
"       </td>",
"       <td>",
"        15&nbsp;to 90, duration is dose dependent",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Short-acting barbiturate option for noninvasive diagnostic procedures. Better efficacy seen in children &lt;8 years old.",
"         </li>",
"         <li>",
"          Common adverse effects: Respiratory depression, hypotension, and increased heart rate, especially with intravenous use or combination with opioid or benzodiazepine, emergence reactions",
"         </li>",
"         <li>",
"          Relatively contraindicated in patients with cardiac or hepatic insufficiency or hypovolemic shock",
"         </li>",
"         <li>",
"          Absolute contraindications: Porphyria",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Etomidate",
"       </td>",
"       <td>",
"        <p>",
"         0.1 to 0.3 mg/kg IV",
"        </p>",
"        Lower dose in children with renal or hepatic insufficiency",
"       </td>",
"       <td>",
"        0.05 mg/kg every 3 to 5 minutes titrate up to 0.6 mg/kg total dose to desired sedation",
"       </td>",
"       <td>",
"        &le;0.5",
"       </td>",
"       <td>",
"        5 to 15",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Rapid onset and recovery. Commonly used for brief diagnostic imaging (eg, head CT).",
"         </li>",
"         <li>",
"          Reduces intracranial pressure. Hemodynamic and respiratory stability maintained in most patients making it a good choice if cardiovascular status is unknown or compromised (eg, trauma patient).",
"         </li>",
"         <li>",
"          Common adverse effects: Pain at the injection site, transient nonepileptiform myoclonus, vomiting. Myoclonus and vomiting reduced by premedication with midazolam.",
"         </li>",
"         <li>",
"          Relatively contraindicated in children with severe illness such as suspected sepsis",
"         </li>",
"         <li>",
"          Absolutely contraindications: Children with congenital or acquired adrenal insufficiency",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Methohexital",
"       </td>",
"       <td>",
"        0.5 to 1 mg/kg IV",
"       </td>",
"       <td>",
"        0.5 mg/kg IV (maximum 40 mg per dose)every 2 to 5 minutes, titrate&nbsp;up to 2 mg/kg (160 mg total dose)",
"       </td>",
"       <td>",
"        0.5 to 1",
"       </td>",
"       <td>",
"        5 to 10",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Short-acting barbiturate option for noninvasive diagnostic procedures. More adverse events than pentobarbital.",
"         </li>",
"         <li>",
"          Common adverse effects: Respiratory depression, hypotension, and myocardial depression",
"         </li>",
"         <li>",
"          Relative contraindications: Patients with cardiac, liver, or renal insufficiency",
"         </li>",
"         <li>",
"          Absolute contraindications: Porphyria or partial seizure disorder (may precipitate seizures)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Doses are given as a suggested range for the initial dose. Children may differ markedly with respect to efficacy of any single dose and careful titration to effect by using repetitive dosing to achieve the desired depth and duration of sedation is necessary for any individual patient. Suggested initial doses should be reduced &asymp; fifty percent for patients who are debilitated or with reduced cardiac output. These medications do not provide analgesia.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      In some institutions, propofol is ONLY approved for use by anesthesiologists or others with specialized pediatric procedural sedation training. Otherwise, propofol use for procedural sedation in children may be unlicensed. Check local policies.",
"      <br>",
"       &Delta; Some providers start the propofol infusion at a higher rate (eg, 100 mcg/kg per minute) because few children will be adequately sedated at lower infusion rates.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f32_0_32782=[""].join("\n");
